import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import ConstantMenu from './components/ConstantMenu/constantMenu.jsx';
import ProfilePage from './components/ProfilePage/profile.jsx';
import FilmCatalogPage from './components/FilmCatalogPage/filmCatalogPage.jsx';
import BookCatalogPage from './components/BookCatalogPage/bookCatalogPage.jsx';

const App = (props) => {
  return (
    <Router>
      <div className="App">
        <ConstantMenu />
      </div>
      <div className="app-wrapper-content">
          <Routes>
            <Route path='/profile' element={<DialogsContainer />}/>
            <Route path='/filmCtalog' element={<Profile />}/>
            <Route path='/bookCatalog' element={<News/>}/>
          </Routes>
      </div>
    </Router>
  );
}

export default App;
